CREATE DEFINER=`root`@`%` PROCEDURE `CreateBookings` (IN `academicYearId` INT)   BEGIN
    DECLARE academicStart DATE;
    DECLARE academicEnd DATE;
    DECLARE currentDate DATE;
    DECLARE result INT;
    DECLARE maxClassId INT;
    DECLARE currentId INT;
    DECLARE currentStart DATETIME;
    DECLARE currentEnd DATETIME;
    DECLARE currentSubject INT;
    DECLARE currentRoom INT;
    DECLARE currentActivity INT;
    DECLARE currentDay INT;
    DECLARE currentWeekId INT;
    DECLARE endWeekId INT;


CREATE TABLE IF NOT EXISTS TmpWeek (
        Id INT AUTO_INCREMENT PRIMARY KEY,
        ClassId INT,
        SubjectId INT,
        RoomId INT,
        StartTime TIME,
        EndTime TIME
    );


SELECT `Start`, `End` INTO academicStart, academicEnd FROM AcademicYears
        WHERE Id = academicYearId;


SET currentDate = academicStart;


WHILE currentDate <= academicEnd DO
        SELECT COUNT(*) INTO result FROM DaysOff
            WHERE currentDate >= DATE(`From`) AND currentDate <= DATE(`To`);

        IF result > 0 OR DAYOFWEEK(currentDate) = 1 THEN

SET currentStart = DATE_ADD(currentDate, INTERVAL '0' HOUR);
            SET currentEnd = DATE_ADD(currentDate, INTERVAL '23:59:59' HOUR_SECOND);
            SET currentActivity = 8;


SELECT MAX(Id) INTO maxClassId FROM Classes ORDER BY Id;
            SET currentId = 1;

            WHILE currentId <= maxClassId DO
                    VALUES (currentStart, currentEnd, currentId, currentActivity);

                SET currentId = currentId + 1;
            END WHILE;

            SET currentDate = DATE_ADD(currentDate, INTERVAL 1 DAY);
        ELSE

SET currentActivity = 1;


SELECT MAX(Id) INTO maxClassId FROM Classes ORDER BY Id;
            SET currentId = 1;

            WHILE currentId <= maxClassId DO
                DELETE FROM TmpWeek;
                ALTER TABLE TmpWeek AUTO_INCREMENT = 1;

                SET currentDay = DAYOFWEEK(currentDate);
                    SELECT `ClassId`, `SubjectId`, `RoomId`, `StartTime`, `EndTime` FROM WeeklyTimetableTemplates WHERE `DayOfWeek`= currentDay AND `ClassId` = currentId;

                SELECT MIN(Id), MAX(Id) INTO currentWeekId, endWeekId FROM TmpWeek ORDER BY Id;


WHILE currentWeekId <= endWeekId DO
                            DATE_ADD(currentDate, INTERVAL StartTime HOUR_SECOND) AS `Start`,
                            DATE_ADD(currentDate, INTERVAL EndTime HOUR_SECOND) AS `End`,
                            `ClassId`,
                            `SubjectId`,
                            `RoomId`,
                            currentActivity
                        FROM TmpWeek
                        WHERE Id = currentWeekId);

                    SET currentWeekId = currentWeekId + 1;
                END WHILE;

                SET currentId = currentId + 1;
            END WHILE;

            SET currentDate = DATE_ADD(currentDate, INTERVAL 1 DAY);
        END IF;

    END WHILE;

    DROP TABLE IF EXISTS TmpWeek;
END$$

